data.value:
CREATE PROCEDURE [dbo].[pCreateReportMonitoring]
	@eventcode NVARCHAR(50),
	@consolidationid INT,
	@userid INT,
	@isvalid BIT = NULL,
	@resulttext NVARCHAR(MAX) = NULL,
	@comment NVARCHAR(MAX) = NULL,
	@vstrTaxPeriod NVARCHAR(4) = NULL,
	@vintTaxReportPeriod INT = NULL, 
	@vstrTaxReportPeriod NVARCHAR(255) = NULL,
	@period DATETIME = NULL
AS
BEGIN
		-- =============================================
	-- Автор:		  Шкидин Александр
	-- Дата создания: 08.11.2018
	-- Описание:	  Создает записи монитора контроля для печатных форм
	-- Параметры: 
	--1) @eventcode - поле для определения, что за отчёт([ReportMonitoringEventType].[Code]). Передаём из отчёта
	--2) @userId передаётся через пользовательский интерфейс в отчёт, необходимо добавить параметр userid в отчет и 
		--при сохранении в PrintedFormRegistry установить значение "User":"@currentUserId" в поле "Параметры"
	--3) @consolidationid - консолидация передаётся из отчёта
	--4) @isvalid - передаётся из отчёта в TRY CATCH при выполнении, если отчёт обвалился в CATCH - false или были выявлены расхождения, 
		--иначе - true(поиск расхождений вынужден делать в отчёте)
	--5) @resulttext - Значение "Расхождения не выявлены" в случае отсутствия расходжений по результату выполнения отчета; 
		--значение "Выявлены расхождения"в случае наличия расходжений по результату выполнения отчета; 
		--значение "Ошибка при построении отчета" в случае возникновения ошибок при выполнении отчета;
	--6) @comment - передаётся в случае исключения из отчёта
	--7) @vstrTaxPeriod - год квартала, по которому вычисляется период (7967)
	--8) @vintTaxReportPeriod - 1 - 1 квартал, 2 - 2 квартал, 3 - 3 квартал, NULL или 4 -год для отчётов: 
		-- 7968-7969(значения 1-4), 7970(значения 1-3 и NULL)
	--9) @vstrTaxReportPeriod - строковый период (7967)
	--10) @period - период для задачи 7977
	--11) @IFNS - специфичное поле для создания монитора контроля по задачам 7968-7970. Для создания монитора должен быть равен NULL
	-- =============================================
	DECLARE 
		@startdate DATETIME,
		@enddate DATETIME,
		@startdatestr NVARCHAR(40),
		@enddatestr NVARCHAR(40),
		@reportcode NVARCHAR(MAX),
		@iterationindex INT,
		@eventTypeID INT,
		@reportname NVARCHAR(MAX),
		@sibuserid INT

	IF @eventcode = N'Report_LandTaxRatesControl' --задача 7967
	BEGIN
		SELECT TOP 1 @reportcode = [ReportPublishCode]
		FROM [ReportService].[Reports]
		WHERE LOWER(RTRIM([Name])) = N'контроль применения ставок и льгот по земельному налогу' AND ([Hidden] = 0 OR [Hidden] IS NULL)

		SET @reportname = N'Контроль применения ставок и льгот. Земельный налог.';
		SET @startdate = [dbo].[QuarterToDate](@vstrTaxReportPeriod, @vstrTaxPeriod, 0);
		SET @enddate = [dbo].[QuarterToDate](@vstrTaxReportPeriod, @vstrTaxPeriod, 1);
		SET @startdatestr = CONVERT(NVARCHAR, YEAR(@startdate)) + '.' + CONVERT(NVARCHAR, MONTH(@startdate)) + '.' + CONVERT(NVARCHAR, DAY(@startdate))
		SET @enddatestr = CONVERT(NVARCHAR, YEAR(DATEADD(day, 1, @enddate))) + '.' + CONVERT(NVARCHAR, MONTH(DATEADD(day, 1, @enddate))) + '.' + CONVERT(NVARCHAR, DAY(DATEADD(day, 1, @enddate)))
	END;
	ELSE IF @eventcode = N'Report_TransportTaxValidCalc' --задача 7968
	BEGIN
		SELECT TOP 1 @reportcode = [ReportPublishCode]
		FROM [ReportService].[Reports]
		WHERE LOWER(RTRIM([Name])) = N'налоговый регистр по транспортному налогу' AND ([Hidden] = 0 OR [Hidden] IS NULL)

		SET @reportname = N'Контроль корректности расчета налога. Транспортный налог.';
		SET @startdate = [dbo].[QuarterToDate](@vstrTaxReportPeriod, @vstrTaxPeriod, 0);
		SET @enddate = [dbo].[QuarterToDate](@vstrTaxReportPeriod, @vstrTaxPeriod, 1);
		SET @startdatestr = CONVERT(NVARCHAR, YEAR(@startdate)) + '.' + CONVERT(NVARCHAR, MONTH(@startdate)) + '.' + CONVERT(NVARCHAR, DAY(@startdate))
		SET @enddatestr = CONVERT(NVARCHAR, YEAR(DATEADD(day, 1, @enddate))) + '.' + CONVERT(NVARCHAR, MONTH(DATEADD(day, 1, @enddate))) + '.' + CONVERT(NVARCHAR, DAY(DATEADD(day, 1, @enddate)))
	END
	ELSE IF @eventcode = N'Report_PropertyTaxValidCalc' --задача 7969
	BEGIN
		SELECT TOP 1 @reportcode = [ReportPublishCode]
		FROM [ReportService].[Reports]
		WHERE LOWER(RTRIM([Name])) = N'налоговый регистр по налогу на имущество' AND ([Hidden] = 0 OR [Hidden] IS NULL)

		SET @reportname = N'Контроль корректности расчета налога на имущество.';
		SET @startdate = [dbo].[QuarterToDate](@vstrTaxReportPeriod, @vstrTaxPeriod, 0);
		SET @enddate = [dbo].[QuarterToDate](@vstrTaxReportPeriod, @vstrTaxPeriod, 1);
		SET @startdatestr = CONVERT(NVARCHAR, YEAR(@startdate)) + '.' + CONVERT(NVARCHAR, MONTH(@startdate)) + '.' + CONVERT(NVARCHAR, DAY(@startdate))
		SET @enddatestr = CONVERT(NVARCHAR, YEAR(DATEADD(day, 1, @enddate))) + '.' + CONVERT(NVARCHAR, MONTH(DATEADD(day, 1, @enddate))) + '.' + CONVERT(NVARCHAR, DAY(DATEADD(day, 1, @enddate)))
	END

	SELECT @eventTypeID = et.[ID]
	FROM [EUSI.NSI].[ReportMonitoringEventType] AS et
	INNER JOIN [CorpProp.Base].[DictObject] AS do ON et.[ID] = do.[ID]
	WHERE do.[Code] = @eventcode

	SELECT TOP 1 @sibuserid = [ID]
	FROM [CorpProp.Security].[SibUser] 
	WHERE [UserID] = @userid

	EXEC [dbo].[pGetMaxIterationIndex]
		@periodstart = @startdatestr,
		@periodend = @enddatestr,
		@consolidation = @consolidationid,
		@mnemonic = NULL,
		@reportcode = @reportcode,
		@index = @iterationindex OUT

	SET @iterationindex = ISNULL(@iterationindex, 0) + 1

	INSERT INTO [EUSI.Report].[ReportMonitoring] 
	(
		[ImportDateTime],
		[ReportName],
		[ReportCode],
		[SibUserID],
		[ConsolidationID],
		[StartDate],
		[EndDate],
		[IsValid],
		[ResultText],
		[IterationIndex],
		[Oid],
		[IsHistory],
		[Hidden],
		[SortOrder],
		[Comment],
		[CreateDate],
		[ActualDate],
		[ReportMonitoringEventTypeID]
	)
	VALUES
	(
		GETDATE(),
		@reportname,
		@reportcode,
		@sibuserid,
		@consolidationid,
		@startdate,
		@enddate,
		@isvalid,
		@resulttext,
		@iterationindex,
		NEWID(),
		0,
		0,
		0,
		@comment,
		GETDATE(),
		GETDATE(),
		@eventTypeID
	)
END

